import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (div with class 'cart') and click it to open the Shopping Cart Modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for the cart modal to appear (div#cartModal with style display: block)
    await page.waitForSelector('div#cartModal', { timeout: 5000 });

    // Wait for the cart modal to be visible
    const cartModalHandle = await page.$('div#cartModal');
    let cartModalVisible = false;
    if (cartModalHandle) {
      cartModalVisible = await cartModalHandle.evaluate(el => {
        return window.getComputedStyle(el).display !== 'none';
      });
    }

    // Take screenshot after opening cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract some cart modal content for verification
    let cartModalTitle = '';
    let cartModalExists = false;
    if (cartModalHandle && cartModalVisible) {
      cartModalExists = true;
      const titleEl = await cartModalHandle.$('h2');
      if (titleEl) {
        cartModalTitle = await titleEl.innerText();
      }
    }

    return {
      success: cartModalExists && cartModalVisible,
      action: "Opened the Shopping Cart Modal by clicking the cart icon",
      extractedData: {
        cartModalVisible,
        cartModalTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
